        <Tab.Screen options=[blank] name="Settings" component={SettingsStackScreen} />
      </Tab.Navigator>
    </NavigationContainer>
  );
}
```

Second way:

```javascript
function SettingsStackScreen({ navigation }) {
    [blank]
